def reconstruction_image(pattern_array, intensity_array):
    weighting_matrix = np.sum(pattern_array, axis=0)
    image_list = []
    for i in range(len(pattern_array)):
        image_list.append(intensity_array[i] * (pattern_array[i]-(pattern_array[i]==0).astype(int)))
    image_array = np.array(image_list)
    image_matrix = np.sum(image_array, axis=0)
    return image_matrix

def smooth_image_matrix(matrix, kernel_size=(5, 5)):
    """
    Apply Gaussian blur to a given image matrix.

    Args:
    - matrix (numpy.ndarray): Input image as a 2D or 3D numpy array.
    - kernel_size (tuple): Size of the Gaussian kernel.

    Returns:
    - numpy.ndarray: Blurred image.
    """

    # Apply Gaussian blur
    blurred = cv2.GaussianBlur(matrix, kernel_size, 0)

    return blurred

